import React from "react"
import "./styling/ExpenseItem.css"
export default function ExpenseItem() {
    return (
        <div className="expense-item">
            <div>December 21, 2022</div>
            <div>
                <h2 class="expense-item--description">Car Insurance</h2>
                <div className="expense-item--price">$243.45</div>   
            </div>
        </div>
    )
}
